import { useState } from "react";
import NavBarMenu from "./NavBar/NavBarMenu";

export default function NavBar() {
  const [showDropdown, setShowDropdown] = useState(false);

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  const menuItems = [
    {
      label: "Home",
      link: "#",
    },
  ];

  return <></>;
}
